import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import FacultyPopup from '././componentsFacultyPopup';

function CustomNavbar({ stickyClass, navbarOpacity }) {
  const [showPopup, setShowPopup] = useState(false);

  return (
    <Navbar expand="lg" className={`w-100 ${stickyClass || 'position-absolute'}`} style={{ opacity: navbarOpacity }}>
      <Container>
        {/* ... other navbar items ... */}
        <div onMouseEnter={() => setShowPopup(true)} onMouseLeave={() => setShowPopup(false)}>
          Faculties
          {showPopup && <FacultyPopup />}
        </div>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
